import "./App.css";
import { React, useState } from "react";
const Pokedex = require("pokedex-promise-v2");
const P = new Pokedex();

function App() {
  let interval = {
    limit: 100,
    offset: 0,
  };
  P.resource("api/v2/pokemon");
  return (
    <div className="App">
      <h1>Hello world</h1>
    </div>
  );
}

export default App;
